function So_al(e){alert(e)}function So_gId(e){return document.getElementById(e)}function So_SetVal(e,t){document.getElementById(e).value=t}function So_GetVal(e){return document.getElementById(e).value}function So_cl(e){console.log(e)}function So_getDT(){var e=new Date;return(e.getFullYear()+" "+(e.getMonth()+1)+" "+e.getDate()+" "+e.getHours()+" "+e.getMinutes()+" "+e.getSeconds()+" "+e.getDay()).split(" ")}function So_sub(n){eval("document."+n+".submit();")}function So_Foc(i){eval('document.getElementById("'+i+'").focus();')}